@Mrs. RockKitty (VixxVoodooKitty) 
I remember when I heard the news that Johnny and Vanessa were dissolving their sweet, family unit, and was incredibly disappointed that  efforts didn't try harder to make it work with Vanessa (or, maybe they did try what the heart wants.  He's human, and he made a mistake.  But, in no way did the decisions that Johnny made warrant the type of treatment he received from Amber.

On a happier note... Johnny and Vanessa appear to be doing a great job --by all accounts-- at co-parenting their children; they continue to be amicable with one another, and seem to be making their particular situation work for them and their children.  Which we love to see, am I right?!
